                    axios.get('http://localhost:8080/login/check', {
                        account: "hello",
                        password: "123"
                    }).then((res) => {
                        console.log(res)
                    })
                }}>Sign In</button>


                <br />
                <button onClick={() => {
                    axios.get("http://localhost:8080/login/").then((res) => {
                        console.log(res)
                    })
                }}>List</button>
                <br />
                if you are new user, you can sigup
                <div>
                    Account <input type={"text"} className="signUpAccount"></input>
                </div>
                <div>
                    Password<input type={"password"} className="signUpPassword"></input>
                </div>
                <button onClick={() => {
                    axios.post('http://localhost:8080/login/signup', {
                        account: document.getElementsByClassName(signUpAccount),
                        password: document.getElementsByClassName(signUpPassword)
                    })
                }}>Sign Up</button>
            </center>
        </div>
    );
}

export default Login;
